import React, { Component } from "react";
import "./index.css";
import * as bootstrap from "bootstrap";
import { useState } from "react";
import { useEffect } from "react";
window.bootstrap = bootstrap;

function Carousel() {
  const [backendBilleder, setBackendBilleder] = useState([{}]);
  const [state, setState] = useState({
    list: [],
    knap: 0
  })

  const slidesnbuttons = (tal) => {
    this.state.list = [];
    for (var i = 1; i < tal; i++) {
      const x = i;
      if (this.state.knap < this.state.ber.length - 1) {
        this.state.list.push(
          <button
            type="button"
            data-bs-target="#carouselExampleIndicators"
            data-bs-slide-to={x}
            aria-label={"Slide " + (x + 1)}
          ></button>
        );
      } else {
        this.state.list.push(
          <div class="carousel-item">
            <img src={this.state.ber[x]} class="d-block w-100" alt="" />
          </div>
        );
      }
      this.state.knap++;
    }
    return this.state.list;
  };

  useEffect(() => {
    const carousel = new bootstrap.Carousel("#carouselExampleIndicators");
    fetch("/billeder")
      .then((response) => response.json())
      .then((billeder) => {
        setBackendBilleder(billeder);
      });
  }, []);

  return (
    <div class="container-carousel">
      <div
        id="carouselExampleIndicators"
        class="carousel slide"
        data-bs-interval="false"
      >
        <div class="carousel-indicators">
          <button
            type="button"
            data-bs-target="#carouselExampleIndicators"
            data-bs-slide-to="0"
            class="active"
            aria-current="true"
            aria-label="Slide 1"
          ></button>

          {slidesnbuttons(this.state.ber.length)}
        </div>

        <div class="carousel-inner">
          <div class="carousel-item active">
            <img src={this.state.mainbillede} class="d-block w-100" alt="" />
          </div>

          {slidesnbuttons(this.state.ber.length)}
        </div>
      </div>
    </div>
  );
}
export default Carousel;
